import React from "react";

const ExpensesFilter = () => {
  return (
    <div className="text-gray-900 px-4  mx-auto w-5/6 max-w-6xl">
      <div className="flex min-w-full items-center justify-between my-4">
        <label className="font-bold mb-2">Filter by year</label>
        <select className="text-inherit py-2 px-12 font-bold rounded-lg">
          <option value="2022">2022</option>
          <option value="2021">2021</option>
          <option value="2020">2020</option>
          <option value="2019">2019</option>
        </select>
      </div>
    </div>
  );
};

export default ExpensesFilter;
